import React from "react";

function User(props) {
    return (
        <thead>
        <tr key={props.id}>
            <th>
                <img alt={props.photo} src={props.firstName}></img>
            </th>
            <td>{props.title} {props.firstName} {props.lastName}</td>
            <td>{props.email}</td>
            <td>{props.dob}</td>
            <td>{props.location}</td>
            <td>{props.phone}</td>
        </tr>
    </thead>,
    <div>{props.title} {props.firstName} {props.lastName} {props.email} {props.phone}{props.dob} {props.location}
        <img src={props.photo}>{props.photo}</img>
     </div>
    )

}

export default User;
